import styled from 'styled-components';
// import { } from 'styled-system';

export const MainBanner = styled.div`
    display: flex;
    justify-content: center;
`;

export const Title = styled.span`
    display: flex;
    background-color: #F2CB04;
    justify-content: center;
    align-items: center;
    width: 392px;
    height: 92px;
    color: black;
    font-size: 48px;
    font-family: Bebas Neue;
`
